(3152, 642, 'post_title', 'ยะ บริการ เริ่มต้น 500 บาท ขนของ ย้ายหอ จัดบูธ โทร 084-727-7005'),
(3153, 642, 'post_content', '<img class="alignnone wp-image-869" src="http://dev.rodrubjang.com/wp-content/uploads/2016/01/C012060405.jpg" alt="C012060405" width="455" height="341" />\r\n\r\nบริการ  ขนของ ย้ายหอ จัดบูธ\r\nขนย้ายออฟฟิต ย้ายบ้าน ส่งสินค้าเข้าท่าเรือ\r\nรถกระบะตู้ทึบหลังคาสูง และรถกระบะโครงเหล็กเปิดหลังคา\r\nบริการขนส่ง ย้ายห้อง ย้ายสำนักงาน ขนย้ายบูธ ขนส่งสินค้าให้บริษัท และส่งของตามห้างสรรพสินค้า\r\nในกรุงเทพฯ\r\nเริ่มต้น 500 บาท\r\n\r\nโทร 0847277005\r\nwww.facebook.com/YakService'),
