(4186, 916, 'post_title', 'หนุ่ย รถกระบะรับจ้าง รถกระบะตู้ทึบหลังคาสูง และรถกระบะโครงเหล็กเปิดหลังคา'),
(4187, 916, 'post_content', 'หนุ่ย รถกระบะรับจ้าง\r\nรถกระบะตู้ทึบหลังคาสูง และรถกระบะโครงเหล็กเปิดหลังคา\r\nบริการขนส่ง ย้ายห้อง ย้ายสำนักงาน ขนย้ายบูธ ขนส่งสินค้าให้บริษัท และส่งของตามห้างสรรพสินค้า\r\nในกรุงเทพฯ เที่ยวละ 700 บาท\r\nเหมาวัน 8 ชั่วโมง 2500 บาท\r\nปริมณทล เที่ยวละ 1000 - 1500 บาท\r\nต่างจังหวัด กิโลเมตรละ 15 บาท\r\nพนักงานยกของ ราคา 200 - 500 บาท\r\n<img class="alignnone size-full wp-image-1072" src="http://dev.rodrubjang.com/wp-content/uploads/2016/03/ads_nui_rodrubjang-1.gif" alt="ads_nui_rodrubjang-1" width="389" height="302" />'),
