(4336, 959, 'post_title', 'บริษัท โอ่งขนส่ง จำกัด รับงานขนส่ง หลายประเภท(ทั่วไป)'),
(4337, 959, 'post_content', '<span style="color: #0000ff;"><strong>บริษัท โอ่งขนส่ง จำกัด</strong></span>\r\nรับงานขนส่ง หลายประเภท(ทั่วไป)\r\nประสบการณ์ในงานขนส่งแบบมืออาชีพ\r\nรถเครน 3,5,6 ตัน , รถ 10 ล้อ พื้นเรียบ\r\nรถกระบะ,รถบรรทุก,รถ 12 ล้อ\r\nรถเทรลเลอร์ 18 ล้อ, โลเบท,หางปลา\r\n<img class="alignnone size-full wp-image-965" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/imgCover-Post5-7674901-20152711101451.jpg" alt="imgCover-Post5-7674901-20152711101451" width="640" height="480" />\r\n\r\n<img class="alignnone size-full wp-image-964" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/imgCover-Post4-3639184-20152711101451.jpg" alt="imgCover-Post4-3639184-20152711101451" width="640" height="480" />\r\n\r\n<img class="alignnone size-full wp-image-963" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/imgCover-Post3-7526474-20152711101451.jpg" alt="imgCover-Post3-7526474-20152711101451" width="640" height="480" />\r\n\r\n<img class="alignnone size-full wp-image-962" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/imgCover-Post2-2631310-20152711101451.jpg" alt="imgCover-Post2-2631310-20152711101451" width="640" height="480" />\r\n\r\n<img class="alignnone wp-image-961" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/imgCover-MePoimg1.jpg" alt="imgCover-MePoimg1" width="639" height="479" />\r\n\r\n<img class="alignnone size-full wp-image-960" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C014012198-5.jpg" alt="C014012198-5" width="640" height="480" />\r\n\r\nรถ 22 ล้อ, รถเม็คโคร\r\nราคาย่อมเยา เป็นกันเอง\r\nบริการทั่วทั้งประเทศ\r\n\r\n086-3131735\r\n081-6329102\r\n086-5368895\r\n034-100610'),
