(4435, 987, 'post_title', 'ทรัพย์คมสันต์ ขนส่ง รถ 6 ล้อรับจ้าง พระราม4 พระราม 5 ปากเกร็ด นนทบุรี'),
(4436, 987, 'adverts_price', '1500'),
(4437, 987, 'post_content', 'ทรัพย์คมสันต์ ขนส่ง\r\n\r\nรถ 6 ล้อรับจ้าง รับจ้างย้ายบ้าน ป้ายโฆษณาสินค้า\r\nย้ายก่อสร้าง อาคารสำนักงาน ขนบูธ ขนเฟอร์นิเจอร์\r\nขนต้นไม้และอื่นๆอีกมากมาย\r\n\r\nรถเราอยู่แถว พระราม4 พระราม 5 ปากเกร็ด นนทบุรี งามวงศ์วาน รามอินทรา สวนสยาม อ้อมน้อย อ้อมใหญ่ สาย 4 สาย 5 บริการดี อัธยาศัยดี รวดเร็ว เชื่อถือได้\r\nราคาถูก\r\n\r\n1. บริการรถ 6 ล้อรับจ้างทุกขนาด คอกสูง มีผ้าใบคลุม\r\nรถหกล้อกลางขนาด 5.50 ม. รับน้ำหนักได้ 7 ตัน\r\nรถหกล้อใหญ่ขนาด 6 เมตร , 6.625 เมตร รับน้ำหนักได้ 7 ตัน กว้าง 2.35 คอกสูง 2.40 เมตร\r\nรถหกล้อจัมโบ้ขนาด 7.20 เมตร รับน้ำหนักได้ 7 ตัน กว้าง 2.40 เมตร คอกสูง 2.40 เมตร\r\n\r\n2. บริการรถกระบะคอกสูง มีผ้าใบคลุม\r\n\r\n<img class="alignnone wp-image-990" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C015055831-3.jpg" alt="C015055831-3" width="533" height="300" />\r\n\r\n<img class="alignnone wp-image-988" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C015055831-1.jpg" alt="C015055831-1" width="533" height="400" />\r\n\r\n<img class="alignnone wp-image-993" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C015055831.jpg" alt="C015055831" width="534" height="400" />\r\n\r\n<img class="alignnone wp-image-992" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C015055831-5.jpg" alt="C015055831-5" width="531" height="708" />\r\n\r\n<img class="alignnone wp-image-991" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C015055831-4.jpg" alt="C015055831-4" width="530" height="397" />\r\nสนใจสอบถามราคาหรือขอใบเสนอราคาก่อนได้ครับผม\r\n\r\nสนใจติดต่อ คุณคมสันต์ (สันต์)\r\nTel : 086-237-7437\r\n\r\nราคาเป็นกันเอง\r\nขอบคุณครับที่ใช้บริการ'),
