(4645, 1060, 'adverts_price', '500'),
(4646, 1060, 'post_content', '<img class="alignnone size-full wp-image-1061" src="http://dev.rodrubjang.com/wp-content/uploads/2016/03/C0120610322-1.jpg" alt="C0120610322-1" width="467" height="331" />\r\nASP SERVICE บริการขนส่งแบบครบวงจรโดยทีมงานมืออาชีพ\r\n081-559-6938\r\n092-881-4554\r\nASP SERVICE บริการขนส่งแบบครบวงจร\r\n1. บริการขนส่งในกรุงเทพฯและปริมณฑล\r\n2. บริการขนส่งพร้อมติดตั้ง และจัดสินค้าตามแบบ งานบูธ, งานอีเวนท์ต่างๆ\r\n3. บริการขนย้าย บ้าน สำนักงาน ฯลฯ\r\n4. บริการรื้อถอนร้านค้าในห้างสรรพสินค้า สำนักงาน ฯลฯ\r\n5. บริการซ่อมระบบไฟฟ้า-ประปาตามบ้าน สำนักงาน ฯลฯ\r\n6. บริการให้เช่านั่งร้าน\r\n7. บริการให้เช่าแอร์\r\n8. บริการพนักงานยกของ\r\nและบริการอื่นๆ อีกมากมาย สามารถติดต่อสอบถามได้ 24 ชม.\r\n\r\nWebsite : www.aspbangkok.com Facebook : ASP BANGKOK'),
