(642, 10, '2016-01-08 23:09:14', '2016-01-08 16:09:14', '<img class="alignnone wp-image-869" src="http://dev.rodrubjang.com/wp-content/uploads/2016/01/C012060405.jpg" alt="C012060405" width="455" height="341" />\r\n\r\nบริการ  ขนของ ย้ายหอ จัดบูธ\r\nขนย้ายออฟฟิต ย้ายบ้าน ส่งสินค้าเข้าท่าเรือ\r\nรถกระบะตู้ทึบหลังคาสูง และรถกระบะโครงเหล็กเปิดหลังคา\r\nบริการขนส่ง ย้ายห้อง ย้ายสำนักงาน ขนย้ายบูธ ขนส่งสินค้าให้บริษัท และส่งของตามห้างสรรพสินค้า\r\nในกรุงเทพฯ\r\nเริ่มต้น 500 บาท\r\n\r\nโทร 0847277005\r\nwww.facebook.com/YakService', 'ยะ บริการ เริ่มต้น 500 บาท ขนของ ย้ายหอ จัดบูธ โทร 084-727-7005', '', 'trash', 'open', 'closed', '', '%e0%b8%82%e0%b8%b2%e0%b8%a2%e0%b8%81%e0%b8%a5%e0%b9%89%e0%b8%ad%e0%b8%87-canon-1100d-%e0%b8%9e%e0%b8%a3%e0%b9%89%e0%b8%ad%e0%b8%a1%e0%b9%80%e0%b8%a5%e0%b8%99%e0%b8%aa%e0%b9%8c-18-55mm-is-4', '', '', '2016-03-01 08:26:12', '2016-03-01 01:26:12', '', 0, 'http://dev.rodrubjang.com/?post_type=post&#038;p=642', 0, 'post', '', 0),
