(803, 1, '2016-02-22 22:21:42', '2016-02-22 15:21:42', '<img class="alignnone wp-image-869" src="http://dev.rodrubjang.com/wp-content/uploads/2016/01/C012060405.jpg" alt="C012060405" width="455" height="341" />\r\n\r\nบริการ  ขนของ ย้ายหอ จัดบูธ\r\nขนย้ายออฟฟิต ย้ายบ้าน ส่งสินค้าเข้าท่าเรือ\r\nรถกระบะตู้ทึบหลังคาสูง และรถกระบะโครงเหล็กเปิดหลังคา\r\nบริการขนส่ง ย้ายห้อง ย้ายสำนักงาน ขนย้ายบูธ ขนส่งสินค้าให้บริษัท และส่งของตามห้างสรรพสินค้า\r\nในกรุงเทพฯ\r\n\r\nเริ่มต้น 500 บาท\r\n\r\nโทร 0847277005\r\nwww.facebook.com/YakService', 'ยะ บริการ เริ่มต้น 500 บาท ขนของ ย้ายหอ จัดบูธ โทร 084-727-7005', '', 'inherit', 'closed', 'closed', '', '642-autosave-v1', '', '', '2016-02-22 22:21:42', '2016-02-22 15:21:42', '', 642, 'http://dev.rodrubjang.com/803/', 0, 'revision', '', 0),
