(894, 1, '2016-02-24 13:14:25', '2016-02-24 06:14:25', 'โอ๋ บริการ รับขนของทั่วไทย\r\nรับงานขนของ ย้ายห้อง ย้ายสำนักงาน และส่งสินค้าบริษัท ทั่วประเทศ\r\nรถกระบะตู้ทึบ กันแดดกันน้ำได้\r\nราคาในกรุงเทพฯ เที่ยวละ 800 บาท\r\nราคาปริมณฑล เที่ยวละ 1000 บาท\r\nต่างจังหวัดกิโลเมตรละ 12 บาท เช่น ระยอง 200 กม. ราคา 2600 บาท\r\nเหมาวันราคา 2200 บาท 9 ชั่วโมง\r\n\r\nคนขนของราคา 200-500\r\n\r\nโทรสอบถามได้ตลอด 24 ชม.\r\n095-892-2715\r\nขอบคุณครับ', 'โอ๋ รถรับจ้าง รถกระบะรับจ้าง รถหกล้อรับจ้าง บริการรับขนของทั่วไทย รถรับจ้างกรุงเทพ', '', 'trash', 'open', 'closed', '', '%e0%b9%82%e0%b8%ad%e0%b9%8b-%e0%b8%a3%e0%b8%96%e0%b8%a3%e0%b8%b1%e0%b8%9a%e0%b8%88%e0%b9%89%e0%b8%b2%e0%b8%87-%e0%b8%a3%e0%b8%96%e0%b8%81%e0%b8%a3%e0%b8%b0%e0%b8%9a%e0%b8%b0%e0%b8%a3%e0%b8%b1%e0%b8%9a', '', '', '2016-03-07 23:35:23', '2016-03-07 16:35:23', '', 0, 'http://dev.rodrubjang.com/?p=894', 0, 'post', '', 0),
