(912, 1, '2016-02-25 13:06:54', '2016-02-25 06:06:54', 'ASP SERVICE บริการขนส่งแบบครบวงจรโดยทีมงานมืออาชีพ\r\n081-559-6938\r\n092-881-4554\r\nASP SERVICE บริการขนส่งแบบครบวงจร\r\n1. บริการขนส่งในกรุงเทพฯและปริมณฑล\r\n2. บริการขนส่งพร้อมติดตั้ง และจัดสินค้าตามแบบ งานบูธ, งานอีเวนท์ต่างๆ\r\n3. บริการขนย้าย บ้าน สำนักงาน ฯลฯ\r\n4. บริการรื้อถอนร้านค้าในห้างสรรพสินค้า สำนักงาน ฯลฯ\r\n5. บริการซ่อมระบบไฟฟ้า-ประปาตามบ้าน สำนักงาน ฯลฯ\r\n6. บริการให้เช่านั่งร้าน\r\n7. บริการให้เช่าแอร์\r\n8. บริการพนักงานยกของ\r\nและบริการอื่นๆ อีกมากมาย สามารถติดต่อสอบถามได้ 24 ชม.\r\n<img class="alignnone size-full wp-image-913" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C0120610322.jpg" alt="C0120610322" width="467" height="331" />\r\nWebsite : www.aspbangkok.com Facebook : ASP BANGKOK', 'ASP Service บริการขนส่งทั่วประเทศ บริการขนส่งพร้อมติดตั้ง', '', 'trash', 'open', 'closed', '', 'asp-service-%e0%b8%9a%e0%b8%a3%e0%b8%b4%e0%b8%81%e0%b8%b2%e0%b8%a3%e0%b8%82%e0%b8%99%e0%b8%aa%e0%b9%88%e0%b8%87%e0%b8%97%e0%b8%b1%e0%b9%88%e0%b8%a7%e0%b8%9b%e0%b8%a3%e0%b8%b0%e0%b9%80%e0%b8%97', '', '', '2016-03-08 12:50:41', '2016-03-08 05:50:41', '', 0, 'http://dev.rodrubjang.com/?p=912', 0, 'post', '', 0),
