(916, 1, '2016-02-25 13:11:02', '2016-02-25 06:11:02', 'หนุ่ย รถกระบะรับจ้าง\r\nรถกระบะตู้ทึบหลังคาสูง และรถกระบะโครงเหล็กเปิดหลังคา\r\nบริการขนส่ง ย้ายห้อง ย้ายสำนักงาน ขนย้ายบูธ ขนส่งสินค้าให้บริษัท และส่งของตามห้างสรรพสินค้า\r\nในกรุงเทพฯ เที่ยวละ 700 บาท\r\nเหมาวัน 8 ชั่วโมง 2500 บาท\r\nปริมณทล เที่ยวละ 1000 - 1500 บาท\r\nต่างจังหวัด กิโลเมตรละ 15 บาท\r\nพนักงานยกของ ราคา 200 - 500 บาท\r\n<img class="alignnone size-full wp-image-1072" src="http://dev.rodrubjang.com/wp-content/uploads/2016/03/ads_nui_rodrubjang-1.gif" alt="ads_nui_rodrubjang-1" width="389" height="302" />', 'หนุ่ย รถกระบะรับจ้าง รถกระบะตู้ทึบหลังคาสูง และรถกระบะโครงเหล็กเปิดหลังคา', '', 'publish', 'open', 'closed', '', '%e0%b8%ab%e0%b8%99%e0%b8%b8%e0%b9%88%e0%b8%a2-%e0%b8%a3%e0%b8%96%e0%b8%81%e0%b8%a3%e0%b8%b0%e0%b8%9a%e0%b8%b0%e0%b8%a3%e0%b8%b1%e0%b8%9a%e0%b8%88%e0%b9%89%e0%b8%b2%e0%b8%87-%e0%b8%a3%e0%b8%96%e0%b8%81', '', '', '2016-03-10 08:18:42', '2016-03-10 01:18:42', '', 0, 'http://dev.rodrubjang.com/?p=916', 0, 'post', '', 0),
(1071, 1, '2016-03-09 23:28:55', '2016-03-09 16:28:55', 'หนุ่ย รถกระบะรับจ้าง\r\nรถกระบะตู้ทึบหลังคาสูง และรถกระบะโครงเหล็กเปิดหลังคา\r\nบริการขนส่ง ย้ายห้อง ย้ายสำนักงาน ขนย้ายบูธ ขนส่งสินค้าให้บริษัท และส่งของตามห้างสรรพสินค้า\r\nในกรุงเทพฯ เที่ยวละ 700 บาท\r\nเหมาวัน 8 ชั่วโมง 2500 บาท\r\nปริมณทล เที่ยวละ 1000 - 1500 บาท\r\nต่างจังหวัด กิโลเมตรละ 15 บาท\r\nพนักงานยกของ ราคา 200 - 500 บาท\r\n<img class="alignnone size-full wp-image-1070" src="http://dev.rodrubjang.com/wp-content/uploads/2016/03/ads_nui_rodrubjang.gif" alt="ads_nui_rodrubjang" width="389" height="302" />', 'หนุ่ย รถกระบะรับจ้าง รถกระบะตู้ทึบหลังคาสูง และรถกระบะโครงเหล็กเปิดหลังคา', '', 'inherit', 'closed', 'closed', '', '916-revision-v1', '', '', '2016-03-09 23:28:55', '2016-03-09 16:28:55', '', 916, 'http://dev.rodrubjang.com/1071', 0, 'revision', '', 0),
(919, 1, '2016-02-25 13:11:02', '2016-02-25 06:11:02', 'หนุ่ย รถกระบะรับจ้าง\r\nรถกระบะตู้ทึบหลังคาสูง และรถกระบะโครงเหล็กเปิดหลังคา\r\nบริการขนส่ง ย้ายห้อง ย้ายสำนักงาน ขนย้ายบูธ ขนส่งสินค้าให้บริษัท และส่งของตามห้างสรรพสินค้า\r\nในกรุงเทพฯ เที่ยวละ 700 บาท\r\nเหมาวัน 8 ชั่วโมง 2500 บาท\r\nปริมณทล เที่ยวละ 1000 - 1500 บาท\r\nต่างจังหวัด กิโลเมตรละ 15 บาท\r\nพนักงานยกของ ราคา 200 - 500 บาท\r\n<img class="alignnone size-full wp-image-917" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C012046720.jpg" alt="C012046720" width="343" height="107" />', 'หนุ่ย รถกระบะรับจ้าง รถกระบะตู้ทึบหลังคาสูง และรถกระบะโครงเหล็กเปิดหลังคา', '', 'inherit', 'closed', 'closed', '', '916-revision-v1', '', '', '2016-02-25 13:11:02', '2016-02-25 06:11:02', '', 916, 'http://dev.rodrubjang.com/919', 0, 'revision', '', 0),
