(958, 1, '2016-02-28 12:45:34', '2016-02-28 05:45:34', 'สิงห์รุ่งเรือง ขนส่ง บริการรถรับจ้าง รถรับจ้างรถขนของ,รถให้เช่า,รถกระบะ,รถ4ล้อใหญ่,\r\nรถบรรทุก6ล้อ,รถรับส่งสินค้าทั่วไทย\r\nบริการตลอด 24 ชม.\r\nสนใจติดต่อ 089-8188649, 086-8867561\r\n\r\n\r\nบริการ ขนส่งสินค้าทั่วไป เช่น ย้ายหอ ย้ายบ้าน ย้ายสำนักงาน-อ๊อฟฟิศ ย้ายเฟอร์นิเจอร์ ย้ายโกดัง\r\nโครงสร้างงานแสดงสินค้า โหลดของเข้าห้างสรรพสินค้า ส่งสินค้าตามโรงงาน\r\n\r\nฉากถ่ายทำภาพ ยนต์ งานทัวร์เวทีคอนเสิร์ต จัดบู๊ธตามห้าง งานอีเว้น ขนนั่งร้าน อุปกรณ์ก่อสร้าง\r\nรับส่งสินค้าทุกชนิด รับงานทั้งกลางวันและกลางคืน และทางเรามีพร้อมพนักงาน\r\n\r\nยกของไว้บริการท่านด้วย เราทีมงานรถรับจ้างยินดีให้บริการ ที่สุภาพ ราคาไม่แพง\r\nและมั่นใจได้เลยว่าสินค้าของท่านถึงจุดหมายปลายทางอย่างปลอดภัย ด้วยคนขับที่ชำนาญทาง เป็นอย่างดี\r\n\r\nราคาเริ่มต้นที่ 500 บาทเฉพาะรถกระบะ\r\n\r\nสนใจบริการของเราติดต่อที่ 089 8188649, 086-8867561\r\n(บริการตลอด24ชั่วโมง)\r\n\r\nประเภทรถให้บริการ\r\n\r\n* รถกระบะ แบบมีข้างเสริม,แบบตู้ทึบ รถ 4 ล้อใหญ่ (ไม่ติดเวลา)\r\n* รถบรรทุก 6 ล้อ ขนาด 5 เมตร ,5.5 เมตร, 6 เมตร,7 เมตร (แบบข้างเสริม)\r\n\r\n\r\nบริการของเรา\r\n* บริการรถขนส่งสินค้าทั่วไป\r\n* บริการขนย้ายที่อยู่อาศัย สำนักงาน\r\n* บริการขนย้ายเฟอร์นิเจอร์\r\n* บริการขนอุปกรณ์งานแสดงสินค้า\r\n* บริการพนักงานยกของ\r\n* บริการถอด &amp; ประกอบเฟอร์นิเจอร์น็อกดาวน์\r\n* บริการทั้งในกรุงเทพฯและต่างจังหวัด\r\n<img class="alignnone  wp-image-957" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C014012198.jpg" alt="C014012198" width="323" height="242" />\r\n\r\n<img class="alignnone size-full wp-image-956" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C014012198-4.jpg" alt="C014012198-4" width="320" height="240" />\r\n<img class="alignnone size-full wp-image-955" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C014012198-3.jpg" alt="C014012198-3" width="320" height="240" />\r\n\r\n<img class="alignnone  wp-image-953" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C014012198-1.jpg" alt="C014012198-1" width="316" height="237" />\r\n\r\n<img class="alignnone  wp-image-954" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C014012198-2.jpg" alt="C014012198-2" width="318" height="251" />\r\n\r\n*รับงานประเภท ,แบบเหม่าเที่ยว,เหม่างาน,เหม่าวัน\r\n\r\n\r\n\r\nสอบถามราคาที่ : 089-818-8649\r\n\r\nในเวลา 08.00 -22.00 น.\r\nอีเมล์ : singrungrueang@gmail.com', 'รถรับจ้างสิงห์รุ่งเรือง ขนส่ง บริการรับส่งสินค้าทั่วไทย รถ 4 ล้อ รถ 6 ล้อ ราคาย่อมเยาว์', '', 'inherit', 'closed', 'closed', '', '952-revision-v1', '', '', '2016-02-28 12:45:34', '2016-02-28 05:45:34', '', 952, 'http://dev.rodrubjang.com/958', 0, 'revision', '', 0),
(959, 1, '2016-02-28 13:23:27', '2016-02-28 06:23:27', '<span style="color: #0000ff;"><strong>บริษัท โอ่งขนส่ง จำกัด</strong></span>\r\nรับงานขนส่ง หลายประเภท(ทั่วไป)\r\nประสบการณ์ในงานขนส่งแบบมืออาชีพ\r\nรถเครน 3,5,6 ตัน , รถ 10 ล้อ พื้นเรียบ\r\nรถกระบะ,รถบรรทุก,รถ 12 ล้อ\r\nรถเทรลเลอร์ 18 ล้อ, โลเบท,หางปลา\r\n<img class="alignnone size-full wp-image-965" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/imgCover-Post5-7674901-20152711101451.jpg" alt="imgCover-Post5-7674901-20152711101451" width="640" height="480" />\r\n\r\n<img class="alignnone size-full wp-image-964" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/imgCover-Post4-3639184-20152711101451.jpg" alt="imgCover-Post4-3639184-20152711101451" width="640" height="480" />\r\n\r\n<img class="alignnone size-full wp-image-963" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/imgCover-Post3-7526474-20152711101451.jpg" alt="imgCover-Post3-7526474-20152711101451" width="640" height="480" />\r\n\r\n<img class="alignnone size-full wp-image-962" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/imgCover-Post2-2631310-20152711101451.jpg" alt="imgCover-Post2-2631310-20152711101451" width="640" height="480" />\r\n\r\n<img class="alignnone wp-image-961" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/imgCover-MePoimg1.jpg" alt="imgCover-MePoimg1" width="639" height="479" />\r\n\r\n<img class="alignnone size-full wp-image-960" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C014012198-5.jpg" alt="C014012198-5" width="640" height="480" />\r\n\r\nรถ 22 ล้อ, รถเม็คโคร\r\nราคาย่อมเยา เป็นกันเอง\r\nบริการทั่วทั้งประเทศ\r\n\r\n086-3131735\r\n081-6329102\r\n086-5368895\r\n034-100610', 'บริษัท โอ่งขนส่ง จำกัด รับงานขนส่ง หลายประเภท(ทั่วไป)', '', 'publish', 'closed', 'closed', '', '%e0%b8%9a%e0%b8%a3%e0%b8%b4%e0%b8%a9%e0%b8%b1%e0%b8%97-%e0%b9%82%e0%b8%ad%e0%b9%88%e0%b8%87%e0%b8%82%e0%b8%99%e0%b8%aa%e0%b9%88%e0%b8%87-%e0%b8%88%e0%b8%b3%e0%b8%81%e0%b8%b1%e0%b8%94-%e0%b8%a3', '',