(1087, 1, '2016-03-11 17:13:04', '2016-03-11 10:13:04', '<img class="alignnone size-full wp-image-1037" src="http://dev.rodrubjang.com/wp-content/uploads/2016/03/oh_rodrubjang-1.gif" alt="oh_rodrubjang-1" width="389" height="302" />\r\n\r\nโอ๋ บริการ รับขนของทั่วไทย\r\nรับงานขนของ ย้ายห้อง ย้ายสำนักงาน และส่งสินค้าบริษัท ทั่วประเทศ\r\nรถกระบะตู้ทึบ กันแดดกันน้ำได้\r\nราคาในกรุงเทพฯ เที่ยวละ 800 บาท\r\nราคาปริมณฑล เที่ยวละ 1000 บาท\r\nต่างจังหวัดกิโลเมตรละ 12 บาท เช่น ระยอง 200 กม. ราคา 2600 บาท\r\nเหมาวันราคา 2200 บาท 9 ชั่วโมง\r\n\r\nคนขนของราคา 200-500\r\n\r\nโทรสอบถามได้ตลอด 24 ชม.\r\n095-892-2715\r\nขอบคุณครับ', 'โอ๋ รถรับจ้าง รถกระบะรับจ้าง รถหกล้อรับจ้าง บริการรับขนของทั่วไทย รถรับจ้างกรุงเทพ', '', 'inherit', 'closed', 'closed', '', '995-revision-v1', '', '', '2016-03-11 17:13:04', '2016-03-11 10:13:04', '', 995, 'http://dev.rodrubjang.com/1087', 0, 'revision', '', 0),
