(973, 1, '2016-02-28 16:19:01', '2016-02-28 09:19:01', '<p class="yellow24">ก้อรถรับจ้าง บริการทั่วประเทศตลอด 24 ชั่วโมง</p>\r\nบริการขนส่งสินค้า ตั้งบูธ งานแสดงสินค้า ย้ายห้อง ย้ายบ้าน และย้ายสำนักงาน ด้วยคุณภาพในการบริการ ซื่อสัตย์ ตรงเวลา ไว้ใจ ในบริการขนส่งได้อย่างสบายใจ ด้วยประสบการณ์มากว่า 10 ปี\r\n<img class="alignnone size-full wp-image-976" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/kor.jpg" alt="kor" width="577" height="280" /> <img class="alignnone size-full wp-image-977" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/kor1.jpg" alt="kor1" width="597" height="277" /> <img class="alignnone size-full wp-image-975" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/2product_r5_c2.jpg" alt="2product_r5_c2" width="281" height="239" /> <img class="alignnone size-full wp-image-978" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/ss.jpg" alt="ss" width="482" height="380" /> <img class="alignnone size-full wp-image-979" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/ssff.jpg" alt="ssff" width="478" height="374" /> <img class="alignnone size-full wp-image-974" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/2product_r1_c1.jpg" alt="2product_r1_c1" width="281" height="249" />\r\n\r\n<img src="http://www.sommailogistic.com/images/spacer.gif" alt="" width="30" height="10" />เรามีการให้บริการรถกระบะตู้ทึบ และรถกระบะโครงเหล็กเปิดหลังคา และรถหกล้อ หลากหลายประเภทตามความต้องการของลูกค้า โทรสอบถามประเภทรถและราคาได้ตลอด 24 ชั่วโมง\r\n\r\n<strong>รถกระบะ ในกรุงเทพ</strong>\r\nราคา 300 – 1,000 บาท\r\n\r\n<strong>ต่างจังหวัด</strong>\r\nคิดตามระยะทาง กิโลเมตรละ 12 – 15 บาท\r\n\r\n<strong>รถหกล้อ ในกรุงเทพ</strong>\r\nราคา 2,500 – 3,000 บาท\r\n\r\nต่างจังหวัด\r\nคิดตามระยะทาง กิโลเมตรละ 25 – 30 บาท\r\n\r\nพนักงานขนของ\r\n\r\nในกรุงเทพ คนละ 200 – 300 บาท\r\n\r\nต่างจังหวัด คนละ 300 – 500 บาท\r\n\r\n<strong>087-0202667</strong>\r\n<strong>086-8943205</strong>', 'ก้อรถรับจ้าง บริการทั่วประเทศตลอด 24 ชั่วโมง บริการขนส่งสินค้า ตั้งบูธ งานแสดงสินค้า', '', 'publish', 'open', 'closed', '', '%e0%b8%81%e0%b9%89%e0%b8%ad%e0%b8%a3%e0%b8%96%e0%b8%a3%e0%b8%b1%e0%b8%9a%e0%b8%88%e0%b9%89%e0%b8%b2%e0%b8%87-%e0%b8%9a%e0%b8%a3%e0%b8%b4%e0%b8%81%e0%b8%b2%e0%b8%a3%e0%b8%97%e0%b8%b1%e0%b9%88%e0%b8%a7', '', '', '2016-03-11 17:49:20', '2016-03-11 10:49:20', '', 0, 'http://dev.rodrubjang.com/?p=973', 0, 'post', '', 0),
