(980, 1, '2016-02-28 16:19:01', '2016-02-28 09:19:01', '<p class="yellow24">ก้อรถรับจ้าง บริการทั่วประเทศตลอด 24 ชั่วโมง</p>\r\nบริการขนส่งสินค้า ตั้งบูธ งานแสดงสินค้า ย้ายห้อง ย้ายบ้าน และย้ายสำนักงาน ด้วยคุณภาพในการบริการ ซื่อสัตย์ ตรงเวลา ไว้ใจ ในบริการขนส่งได้อย่างสบายใจ ด้วยประสบการณ์มากว่า 10 ปี\r\n<img class="alignnone size-full wp-image-976" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/kor.jpg" alt="kor" width="577" height="280" /> <img class="alignnone size-full wp-image-977" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/kor1.jpg" alt="kor1" width="597" height="277" /> <img class="alignnone size-full wp-image-975" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/2product_r5_c2.jpg" alt="2product_r5_c2" width="281" height="239" /> <img class="alignnone size-full wp-image-978" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/ss.jpg" alt="ss" width="482" height="380" /> <img class="alignnone size-full wp-image-979" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/ssff.jpg" alt="ssff" width="478" height="374" /> <img class="alignnone size-full wp-image-974" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/2product_r1_c1.jpg" alt="2product_r1_c1" width="281" height="249" />\r\n\r\n<img src="http://www.sommailogistic.com/images/spacer.gif" alt="" width="30" height="10" />เรามีการให้บริการรถกระบะตู้ทึบ และรถกระบะโครงเหล็กเปิดหลังคา และรถหกล้อ หลากหลายประเภทตามความต้องการของลูกค้า โทรสอบถามประเภทรถและราคาได้ตลอด 24 ชั่วโมง\r\n\r\n<strong>รถกระบะ ในกรุงเทพ</strong>\r\nราคา 300 – 1,000 บาท\r\n\r\n<strong>ต่างจังหวัด</strong>\r\nคิดตามระยะทาง กิโลเมตรละ 12 – 15 บาท\r\n\r\n<strong>รถหกล้อ ในกรุงเทพ</strong>\r\nราคา 2,500 – 3,000 บาท\r\n\r\nต่างจังหวัด\r\nคิดตามระยะทาง กิโลเมตรละ 25 – 30 บาท\r\n\r\nพนักงานขนของ\r\n\r\nในกรุงเทพ คนละ 200 – 300 บาท\r\n\r\nต่างจังหวัด คนละ 300 – 500 บาท\r\n\r\n<strong>087-0202667</strong>\r\n<strong>086-8943205</strong>', 'ก้อรถรับจ้าง บริการทั่วประเทศตลอด 24 ชั่วโมง บริการขนส่งสินค้า ตั้งบูธ งานแสดงสินค้า', '', 'inherit', 'closed', 'closed', '', '973-revision-v1', '', '', '2016-02-28 16:19:01', '2016-02-28 09:19:01', '', 973, 'http://dev.rodrubjang.com/980', 0, 'revision', '', 0),
(981, 1, '2016-02-28 17:36:21', '2016-02-28 10:36:21', '1. รถ 6 ล้อ ยาว 5.60 ม. กว้าง 2.10 ม. สูง 2.00 ม. รับน้ำหนักได้ไม่เกิน 7 ตัน\r\n2. มีผ้าใบคลุมปิดมิดชิด (ผ้าใบผืนเล็ก&amp;amp;amp;ใหญ่)\r\n3. บริการขนย้ายสิ่งของ-อุปกรณ์เครื่องใช้สำนักงานต่าง ๆ ทั้งในกทม.และ ต่างจังหวัด\r\n4. ราคาของค่ารถจะขึ้นอยู่กับการขนของ/เที่ยว หรือตามแต่ตกลง\r\n\r\n<img class="alignnone wp-image-984" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C014045657.jpg" alt="C014045657" width="407" height="543" />\r\n\r\n<img class="alignnone wp-image-983" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C014045657-1.jpg" alt="C014045657-1" width="407" height="543" />\r\n\r\n<img class="alignnone size-full wp-image-1092" src="http://dev.rodrubjang.com/wp-content/uploads/2016/03/ads_jatupon.gif" alt="ads_jatupon" width="389" height="302" />\r\n\r\n(ราคาเริ่มต้นอยู่ที่ 1,500 บาท)\r\nหมายเหตุ ราคานี้อาจมีการเปลี่ยนแปลงซึ่งจะขึ้นอยู่กับระยะทาง\r\n\r\nที่อยู่\r\n14/4 ม.14 ซ.กอไผ่ ข.ตลิ่งชัน ข.ตลิ่งชัน กทม. 10170\r\n\r\nเบอร์โทรศัพท์\r\n086-1036328\r\n089-4915195', 'จตุพล รถ 6 ล้อรับจ้าง รถรับจ้างทั่วไป รถรับจ้าง บริการขนส่งขนย้าย', '', 'publish', 'open', 'closed', '', '%e0%b8%88%e0%b8%95%e0%b8%b8%e0%b8%9e%e0%b8%a5-%e0%b8%a3%e0%b8%96-6-%e0%b8%a5%e0%b9%89%e0%b8%ad-%e0%b8%a3%e0%b8%b1%e0%b8%9a%e0%b8%88%e0%b9%89%e0%b8%b2%e0%b8%87%e0%b8%97%e0%b8%b1%e0%b9%88%e0%b8%a7', '', '', '2016-03-12 15:29:29', '2016-03-12 08:29:29', '', 0, 'http://dev.rodrubjang.com/?p=981', 0, 'post', '', 0),
(1093, 1, '2016-03-12 15:29:11', '2016-03-12 08:29:11', '1. รถ 6 ล้อ ยาว 5.60 ม. กว้าง 2.10 ม. สูง 2.00 ม. รับน้ำหนักได้ไม่เกิน 7 ตัน\n2. มีผ้าใบคลุมปิดมิดชิด (ผ้าใบผืนเล็ก&amp;amp;amp;ใหญ่)\n3. บริการขนย้ายสิ่งของ-อุปกรณ์เครื่องใช้สำนักงานต่าง ๆ ทั้งในกทม.และ ต่างจังหวัด\n4. ราคาของค่ารถจะขึ้นอยู่กับการขนของ/เที่ยว หรือตามแต่ตกลง\n\n<img class="alignnone wp-image-984" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C014045657.jpg" alt="C014045657" width="407" height="543" />\n\n<img class="alignnone wp-image-983" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C014045657-1.jpg" alt="C014045657-1" width="407" height="543" />\n\n<img class="alignnone size-full wp-image-982" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/ads_jatupon.gif" alt="ads_jatupon" width="274" height="187" />\n\n(ราคาเริ่มต้นอยู่ที่ 1,500 บาท)\nหมายเหตุ ราคานี้อาจมีการเปลี่ยนแปลงซึ่งจะขึ้นอยู่กับระยะทาง\n\nที่อยู่\n14/4 ม.14 ซ.กอไผ่ ข.ตลิ่งชัน ข.ตลิ่งชัน กทม. 10170\n\nเบอร์โทรศัพท์\n086-1036328\n089-4915195', 'จตุพล รถ 6 ล้อรับจ้าง รถรับจ้างทั่วไป รถรับจ้าง บริการขนส่งขนย้าย', '', 'inherit', 'closed', 'closed', '', '981-autosave-v1', '', '', '2016-03-12 15:29:11', '2016-03-12 08:29:11', '', 981, 'http://dev.rodrubjang.com/1093', 0, 'revision', '', 0),
