(1004, 1, '2016-02-28 17:51:33', '2016-02-28 10:51:33', 'รถกระบะ ขนย้ายสิ่งของ เครื่องจักรฯ ย้ายบาท หอพัก\r\nย้ายสำนักงาน ออกบูธ งานแสดงสินค้า\r\nรถสภาพใหม่ ราคากันเอง\r\n<img class="alignnone size-full wp-image-999" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C012017559-1.jpg" alt="C012017559-1" width="600" height="450" /> <img class="alignnone size-full wp-image-1000" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C012017559-2.jpg" alt="C012017559-2" width="600" height="450" /> <img class="alignnone size-full wp-image-1001" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C012017559-3.jpg" alt="C012017559-3" width="600" height="450" /> <img class="alignnone size-full wp-image-1002" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C012017559.jpg" alt="C012017559" width="600" height="450" /> <img class="alignnone size-full wp-image-1003" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C015055831-7.jpg" alt="C015055831-7" width="600" height="450" />\r\nหลังคาสูง 2.90 เมตร\r\n\r\nติดต่อ คุณศักดิ์ชัย\r\n\r\nโทร 086-066-9950\r\n081-930-8548', 'หจก. ไมล์หรือ เอ็กซ์เพรส บริการรถกระบะหลังคาสูง รับจ้างขนส่งสินค้า ทั่วประเทศ', '', 'inherit', 'closed', 'closed', '', '998-revision-v1', '', '', '2016-02-28 17:51:33', '2016-02-28 10:51:33', '', 998, 'http://dev.rodrubjang.com/1004', 0, 'revision', '', 0),
(1094, 1, '2016-03-12 15:29:29', '2016-03-12 08:29:29', '1. รถ 6 ล้อ ยาว 5.60 ม. กว้าง 2.10 ม. สูง 2.00 ม. รับน้ำหนักได้ไม่เกิน 7 ตัน\r\n2. มีผ้าใบคลุมปิดมิดชิด (ผ้าใบผืนเล็ก&amp;amp;amp;ใหญ่)\r\n3. บริการขนย้ายสิ่งของ-อุปกรณ์เครื่องใช้สำนักงานต่าง ๆ ทั้งในกทม.และ ต่างจังหวัด\r\n4. ราคาของค่ารถจะขึ้นอยู่กับการขนของ/เที่ยว หรือตามแต่ตกลง\r\n\r\n<img class="alignnone wp-image-984" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C014045657.jpg" alt="C014045657" width="407" height="543" />\r\n\r\n<img class="alignnone wp-image-983" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/C014045657-1.jpg" alt="C014045657-1" width="407" height="543" />\r\n\r\n<img class="alignnone size-full wp-image-1092" src="http://dev.rodrubjang.com/wp-content/uploads/2016/03/ads_jatupon.gif" alt="ads_jatupon" width="389" height="302" />\r\n\r\n(ราคาเริ่มต้นอยู่ที่ 1,500 บาท)\r\nหมายเหตุ ราคานี้อาจมีการเปลี่ยนแปลงซึ่งจะขึ้นอยู่กับระยะทาง\r\n\r\nที่อยู่\r\n14/4 ม.14 ซ.กอไผ่ ข.ตลิ่งชัน ข.ตลิ่งชัน กทม. 10170\r\n\r\nเบอร์โทรศัพท์\r\n086-1036328\r\n089-4915195', 'จตุพล รถ 6 ล้อรับจ้าง รถรับจ้างทั่วไป รถรับจ้าง บริการขนส่งขนย้าย', '', 'inherit', 'closed', 'closed', '', '981-revision-v1', '', '', '2016-03-12 15:29:29', '2016-03-12 08:29:29', '', 981, 'http://dev.rodrubjang.com/1094', 0, 'revision', '', 0),
