(1033, 1, '2016-03-06 13:26:25', '2016-03-06 06:26:25', '<strong><span style="color: #0099cc;">บริษัท สหวิส อินเตอร์เฟรท จำกัด   รถรับจ้าง ขนส่งสินค้า กระจายสินค้าทั่วประเทศ\r\n</span></strong>\r\n\r\n<span style="font-size: medium;"> ดำเนินธุรกิจให้บริการขนส่งสินค้าและกระจายสินค้า บริการทั่วประเทศ\r\nยึดมั่นใน <span style="color: #009900;"><strong>ความพึงพอใจของลูกค้า </strong></span>ด้วยการบริการ\r\nที่มีประสิทธิภาพ<span style="color: #990099;"><strong> รวดเร็ว</strong></span></span> <span style="color: #ff6600; font-size: medium;"><strong>ตรงเวลา</strong></span> <span style="font-size: medium;"><strong><span style="color: #0099cc;">ช่วยประหยัด</span></strong>\r\nค่าใช้จ่ายและเวลาการจัดส่งสินค้าให้ลูกค้า</span>\r\n\r\nบริการด้วยความรับผิดชอบในหน้าที่ ชำนาญงาน ราคายุติธรรม\r\nทีมงานผ่านการอบรมทุกคน ปรึกษาฟรี...\r\n\r\n<img src="http://www.sahawistransport.com/images/contact_index.jpg" alt="" usemap="#Map" width="412" height="252" border="0" />\r\n\r\n<strong><span style="color: #3366ff;">บริการของเรา</span></strong>\r\n- บริการขนส่งด้วยรถบรรทุก 4 ล้อ(ปิคอัพ) ,6 ล้อ,10 ล้อ และเทรเลอร์ แบบต็ทึบ,คอก,พื้นเรียบ,ตู้แห้ง,ห้องเย็น\r\n- บริการขนส่ง , กระจายสินค้า เขตกรุงเทพ-ปริมณฑล และต่างจังหวัด\r\n- บริการแบบเหมาคัน , รายเที่ยว , รายเดือน , งานโครงการ\r\n- บริการให้เช่ารถยนต์พร้อมพนักงานขับรถ<span style="color: #ff0000;"><strong> ฟรี</strong></span>   โฆษณาข้างรถ\r\n- บริการรถขนส่งตามรูปแบบที่ลูกค้าต้องการ\r\n- บริการ รถแห่โฆษณา,งาน <strong>Event</strong> ต่างๆ ทุกพื้นที่ทั่วไทย\r\n\r\n<span style="color: #3366ff;">ติดต่อเรา\r\n<span style="font-family: ''MS Sans Serif'';"><span class="style2">บริษัท สหวิส อินเตอร์เฟรท จำกัด\r\n34/62 ถนนหทัยราษฎร์ แขวงสามวาตะวันตก เขตคลองสามวา กรุงเทพฯ 10510</span></span></span>\r\n\r\n<span style="font-family: ''MS Sans Serif'';"><span class="style4">โทร : <strong>02-<span style="color: #9900cc;">995</span>-<span style="color: #0000ff;">2699</span></strong>\r\nมือถือ : <strong>084-<span class="style1">9159993 </span></strong>\r\nแฟกซ์ : <strong><span style="color: #ff0000;">02-<span style="color: #0000ff;">915</span>-<span style="color: #999900;">4360</span></span></strong>\r\nWebsite : <a href="http://www.sahawistransport.com/" target="_blank"><strong>www.sahawistransport.com</strong></a></span></span><span style="font-family: ''MS Sans Serif''; font-size: small;">\r\nE-mail:</span><span style="font-family: ''MS Sans Serif'';"> <span class="style5"><strong><a class="style4" href="mailto:sahawis01@hotmail.com">sahawis01@hotmail.com </a></strong>\r\n</span></span><span style="font-family: ''MS Sans Serif''; font-size: small;">\r\n<span style="color: #ff0000;"><strong>" ซื่อสัตย์-ตรงเวลา-สินค้ามีประกัน "</strong></span></span>\r\n\r\n&nbsp;', 'รถบรรทุก 4 ล้อ,6 ล้อ,10 ล้อเทรเลอร์, ตู้ทึบ,คอก,พื้นเรียบ,ตู้แห้ง,ห้องแย็น', '', 'inherit', 'closed', 'closed', '', '883-revision-v1', '', '', '2016-03-06 13:26:25', '2016-03-06 06:26:25', '', 883, 'http://dev.rodrubjang.com/1033', 0, 'revision', '', 0),
