(1049, 1, '2016-03-07 23:14:17', '2016-03-07 16:14:17', 'เรา <span class="style1">หจก.ศุภจิรา เอ็กซ์เพรส</span> ด้วยความมุ่งมั่นที่จะสร้างงาน\n\nด้านบริการขนส่งสินค้าและพัสดุภัณฑ์ เพื่อตอบสนองความต้องการต่อองค์กรและหน่วยงาน\nให้ทันสมัยยิ่งขึ้นกับเรื่องของเวลาเร่งรีบ ในการขนส่งสินค้าในสภาวะการจราจรติดขัด\nหรือ จัดส่งไม่ทันเวลา ให้เรา หจก.ศุภจิรา เอ็กซ์เพรส เป็นตัวแทนท่าน\nในการจัดส่ง การบริหารงานด้านจัดการขนส่งสินค้าและพัสดุภัณฑ์ตลอดทั้งเอกสารสำคัญ\nการกระจายสินค้า ขนส่งสินค้า เรามีระบบทุกขั้นตอน ของการปฎิบัติงาน อันทันสมัย สามารถตรวจสอบได้ว่า\nสินค้าที่ท่านส่งถึงมือลูกค้าอย่างถูกต้อง ปลอดภัย เรียบร้อย\n\nด้วยรถขนส่งสินค้าจำนวนมาก สามารถจัดรถตาม\nประเภทของงาน ตามที่ลูกค้าต้องการ รับสินค้าที่โรงงาน\nจัดส่งสินค้าไปยังลูกค้าปลายทาง และนำไปยังคลังสินค้า\nด้วยระบบการทำงาน ขนส่งสินค้าของ หจก.ศุภจิรา เอ็กซ์เพรส ที่ทันสมัย\nและรวดเร็ว ผู้ใช้บริการขนส่งสินค้าสามารถวางใจใน\nคุณภาพของ งานขนส่ง ที่มาตรฐาน และลดต้นทุน\n\n<span style="font-family: ''MS Sans Serif''; font-size: small;"><strong>หจก.ศุภจิรา เอ็กซ์เพรส</strong> ยังสามารถตรวจสอบสถานการณ์ในการจัดส่งสินค้าแบบ real time </span>\n\n<span style="font-family: ''MS Sans Serif''; font-size: small;">จากระบบ gps ซึ่งสะดวก สบายและลูกค้าสามารถมั่นใจได้ว่าสินค้าจะถึงปลายทางอย่างถูกต้อง ทันเวลา ไม่ทำให้เสีย</span>\n\n<span class="style1">หน้าที่บริการ คืองานของเรา </span>\nติดต่อสอบถาม สำนักงานใหญ่ โทร : <strong>02-3201441</strong>\nแฟ็กซ์ : <strong>02-3201441</strong>\nมือถือ : <strong>092-5675847</strong>\n\n<img src="http://www.supajiraexpress.com/images/about/111.gif" alt="" width="419" height="130" />\n\n<img src="http://www.supajiraexpress.com/images/about/2.gif" alt="" width="419" height="130" />\n\n<img src="http://www.supajiraexpress.com/images/about/3.gif" alt="" width="419" height="130" />\n<span style="font-family: ''MS Sans Serif''; font-size: small;">\n<span class="style1">หจก.ศุภจิรา เอ็กซ์เพรส</span>\n</span><span style="color: #000000; font-family: ''MS Sans Serif''; font-size: small;">ที่อยู่ : เลขที่ 501 ซอยพัฒนาการ 74 แขวงประเวศ เขตประเวศ กทม 10250\nโทร <b>02-3201441</b> แฟกซ์ <b>02-3201441</b> มือถือ : <b>092-5675847</b></span><span style="font-family: ''MS Sans Serif''; font-size: small;">\nwebsite : <a href="http://www.supajiraexpress.com/www.supajiraexpress.com" target="_blank">www.supajiraexpress.com</a>\ne - mail : <a href="mailto:supajiramai@hotmail.com">supajiramai@hotmail.com</a></span>', 'บริการขนส่งสินค้าและพัสดุภัณฑ์  ประเภทงานบริการขนส่งสินค้าโดยรถกระบะ( ตู้ทึบสูง 1.50 เมตร )', '', 'inherit', 'closed', 'closed', '', '906-autosave-v1', '', '', '2016-03-07 23:14:17', '2016-03-07 16:14:17', '', 906, 'http://dev.rodrubjang.com/1049', 0, 'revision', '', 0),
(1050, 1, '2016-03-07 23:15:14', '2016-03-07 16:15:14', 'เรา <span class="style1">หจก.ศุภจิรา เอ็กซ์เพรส</span> ด้วยความมุ่งมั่นที่จะสร้างงาน\r\n\r\nด้านบริการขนส่งสินค้าและพัสดุภัณฑ์ เพื่อตอบสนองความต้องการต่อองค์กรและหน่วยงาน\r\nให้ทันสมัยยิ่งขึ้นกับเรื่องของเวลาเร่งรีบ ในการขนส่งสินค้าในสภาวะการจราจรติดขัด\r\nหรือ จัดส่งไม่ทันเวลา ให้เรา หจก.ศุภจิรา เอ็กซ์เพรส เป็นตัวแทนท่าน\r\nในการจัดส่ง การบริหารงานด้านจัดการขนส่งสินค้าและพัสดุภัณฑ์ตลอดทั้งเอกสารสำคัญ\r\nการกระจายสินค้า ขนส่งสินค้า เรามีระบบทุกขั้นตอน ของการปฎิบัติงาน อันทันสมัย สามารถตรวจสอบได้ว่า\r\nสินค้าที่ท่านส่งถึงมือลูกค้าอย่างถูกต้อง ปลอดภัย เรียบร้อย\r\n\r\nด้วยรถขนส่งสินค้าจำนวนมาก สามารถจัดรถตาม\r\nประเภทของงาน ตามที่ลูกค้าต้องการ รับสินค้าที่โรงงาน\r\nจัดส่งสินค้าไปยังลูกค้าปลายทาง และนำไปยังคลังสินค้า\r\nด้วยระบบการทำงาน ขนส่งสินค้าของ หจก.ศุภจิรา เอ็กซ์เพรส ที่ทันสมัย\r\nและรวดเร็ว ผู้ใช้บริการขนส่งสินค้าสามารถวางใจใน\r\nคุณภาพของ งานขนส่ง ที่มาตรฐาน และลดต้นทุน\r\n\r\n<span style="font-family: ''MS Sans Serif''; font-size: small;"><strong>หจก.ศุภจิรา เอ็กซ์เพรส</strong> ยังสามารถตรวจสอบสถานการณ์ในการจัดส่งสินค้าแบบ real time </span>\r\n\r\n<span style="font-family: ''MS Sans Serif''; font-size: small;">จากระบบ gps ซึ่งสะดวก สบายและลูกค้าสามารถมั่นใจได้ว่าสินค้าจะถึงปลายทางอย่างถูกต้อง ทันเวลา ไม่ทำให้เสีย</span>\r\n\r\n<span class="style1">หน้าที่บริการ คืองานของเรา </span>\r\nติดต่อสอบถาม สำนักงานใหญ่ โทร : <strong>02-3201441</strong>\r\nแฟ็กซ์ : <strong>02-3201441</strong>\r\nมือถือ : <strong>092-5675847</strong>\r\n\r\n<img src="http://www.supajiraexpress.com/images/about/111.gif" alt="" width="419" height="130" />\r\n\r\n<img src="http://www.supajiraexpress.com/images/about/2.gif" alt="" width="419" height="130" />\r\n\r\n<img src="http://www.supajiraexpress.com/images/about/3.gif" alt="" width="419" height="130" />\r\n<span style="font-family: ''MS Sans Serif''; font-size: small;">\r\n<span class="style1">หจก.ศุภจิรา เอ็กซ์เพรส</span>\r\n</span><span style="color: #000000; font-family: ''MS Sans Serif''; font-size: small;">ที่อยู่ : เลขที่ 501 ซอยพัฒนาการ 74 แขวงประเวศ เขตประเวศ กทม 10250\r\nโทร <b>02-3201441</b> แฟกซ์ <b>02-3201441</b> มือถือ : <b>092-5675847</b></span><span style="font-family: ''MS Sans Serif''; font-size: small;">\r\nwebsite : <a href="http://www.supajiraexpress.com/www.supajiraexpress.com" target="_blank">www.supajiraexpress.com</a>\r\ne - mail : <a href="mailto:supajiramai@hotmail.com">supajiramai@hotmail.com</a></span>', 'บริการขนส่งสินค้าและพัสดุภัณฑ์  ด้วยรถขนส่งสินค้าจำนวนมาก คุณภาพของ งานขนส่ง ที่มาตรฐาน', '', 'inherit', 'closed', 'closed', '', '906-revision-v1', '', '', '2016-03-07 23:15:14', '2016-03-07 16:15:14', '', 906, 'http://dev.rodrubjang.com/1050', 0, 'revision', '', 0),
