(1067, 1, '2016-03-08 13:20:55', '2016-03-08 06:20:55', 'หนุ่ย รถกระบะรับจ้าง\nรถกระบะตู้ทึบหลังคาสูง และรถกระบะโครงเหล็กเปิดหลังคา\nบริการขนส่ง ย้ายห้อง ย้ายสำนักงาน ขนย้ายบูธ ขนส่งสินค้าให้บริษัท และส่งของตามห้างสรรพสินค้า\nในกรุงเทพฯ เที่ยวละ 700 บาท\nเหมาวัน 8 ชั่วโมง 2500 บาท\nปริมณทล เที่ยวละ 1000 - 1500 บาท\nต่างจังหวัด กิโลเมตรละ 15 บาท\nพนักงานยกของ ราคา 200 - 500 บาท\n<img class="alignnone size-full wp-image-1066" src="http://dev.rodrubjang.com/wp-content/uploads/2016/02/ads_nui_rodrubjang.gif" alt="ads_nui_rodrubjang" width="274" height="187" />', 'หนุ่ย รถกระบะรับจ้าง รถกระบะตู้ทึบหลังคาสูง และรถกระบะโครงเหล็กเปิดหลังคา', '', 'inherit', 'closed', 'closed', '', '916-autosave-v1', '', '', '2016-03-08 13:20:55', '2016-03-08 06:20:55', '', 916, 'http://dev.rodrubjang.com/1067', 0, 'revision', '', 0),
(1073, 1, '2016-03-10 08:18:42', '2016-03-10 01:18:42', 'หนุ่ย รถกระบะรับจ้าง\r\nรถกระบะตู้ทึบหลังคาสูง และรถกระบะโครงเหล็กเปิดหลังคา\r\nบริการขนส่ง ย้ายห้อง ย้ายสำนักงาน ขนย้ายบูธ ขนส่งสินค้าให้บริษัท และส่งของตามห้างสรรพสินค้า\r\nในกรุงเทพฯ เที่ยวละ 700 บาท\r\nเหมาวัน 8 ชั่วโมง 2500 บาท\r\nปริมณทล เที่ยวละ 1000 - 1500 บาท\r\nต่างจังหวัด กิโลเมตรละ 15 บาท\r\nพนักงานยกของ ราคา 200 - 500 บาท\r\n<img class="alignnone size-full wp-image-1072" src="http://dev.rodrubjang.com/wp-content/uploads/2016/03/ads_nui_rodrubjang-1.gif" alt="ads_nui_rodrubjang-1" width="389" height="302" />', 'หนุ่ย รถกระบะรับจ้าง รถกระบะตู้ทึบหลังคาสูง และรถกระบะโครงเหล็กเปิดหลังคา', '', 'inherit', 'closed', 'closed', '', '916-revision-v1', '', '', '2016-03-10 08:18:42', '2016-03-10 01:18:42', '', 916, 'http://dev.rodrubjang.com/1073', 0, 'revision', '', 0),
